import React from "react";
import "./Container.css";
function Container() {
  return (
    <>
      <div className="container">
        <div
          className="pannel active"
          style={{
            backgroundImage:
              "url('https://t4.ftcdn.net/jpg/01/67/74/79/360_F_167747932_NE1da5cf9FM30QExtlFjbmk9ypItoJl2.jpg')",
          }}
        >
          <h3>Explore Live News Updates</h3>
        </div>

        <div
          className="pannel active"
          style={{
            backgroundImage:
              "url('https://image.shutterstock.com/image-photo/photo-old-movie-projector-260nw-92369284.jpg')",
          }}
        >
          <h3>Want to know about the latest movies?</h3>
        </div>

        <div
          className="pannel active"
          style={{
            backgroundImage:
              "url('https://everydaypower.com/wp-content/uploads/2019/05/3-Reasons-Why-Motivation-Alone-Wont-Make-You-Successful.jpg')",
          }}
        >
          <h3>These Quotes will surely lift your spirits!</h3>
        </div>

        <div
          className="pannel active"
          style={{
            backgroundImage:
              "url('https://media.istockphoto.com/photos/small-retro-car-with-baggage-luggage-and-beach-equipment-on-the-roof-picture-id1140063009?k=20&m=1140063009&s=612x612&w=0&h=v4h02KSCtiYNn90v8nt-6jV47cNf4aDS0pNKzx-88R8=')",
          }}
        >
          <h3>In a mood for fun ? Just Click here !</h3>
        </div>
        <div
          className="pannel active"
          style={{
            backgroundImage:
              "url('https://cdn.pixabay.com/photo/2018/01/14/23/12/nature-3082832__480.jpg')",
          }}
        >
          <h3>Explore Live News Updates</h3>
        </div>
      </div>
    </>
  );
}

export default Container;
